// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./@openzeppelin/contracts@4.6.0/token/ERC721/ERC721.sol";
import "./@openzeppelin/contracts@4.6.0/security/Pausable.sol";
import "./@openzeppelin/contracts@4.6.0/access/Ownable.sol";
import "./@openzeppelin/contracts@4.6.0/utils/Strings.sol";
//import "./@openzeppelin/contracts@4.6.0/utils/Counters.sol";


contract MetaDipToken is ERC721, Pausable, Ownable {
    //using Counters for Counters.Counter;

    // EVENTS --------------------------------------------------------------

    event NewCertificateIssued(address _student, string _studentFullName, string _academicTitle, string _cid);
    event NewCertificateRequested(address _student, address _university);
    event ETHTransaction(uint256 _amount, address _from, address _to);
    event Log(string _function, uint _value, address _sender, bytes _data); //"Receive Ether" event


    // VARIABLES --------------------------------------------------------------

    //To increment the tokenId once a NFT was minted
    //Counters.Counter private _tokenIdCounter;

    uint256 CERTIFICATE_PRICE;
    string private _certificateBaseURI;
    string private university;
    address private _owner;

    // CONSTRUCTOR --------------------------------------------------------------

    constructor() ERC721("MetaDip", "MDTkn") {
      CERTIFICATE_PRICE = 1 ether; //just for demonstration
      _certificateBaseURI = "https://nftstorage.link/ipfs/";
      _owner = msg.sender;
    }

    // STRUCTS --------------------------------------------------------------

    struct CertificateInformation{
      string _studentFullName;
      uint256 _matriculationNumber;
      string _gpa;
      string _university;
      string _academicTitle;
    }

    // MAPPING --------------------------------------------------------------

    mapping (address => bool) acceptedRequests;
    mapping (address => mapping(uint8 => CertificateInformation)) dipContent; //dipContent[student][0] would be students first diploma
    mapping (address => uint8) numberOfDiplomas;
    mapping (address => bool) certificateAvailable;
    mapping (address => string) cid;


//------------------------------------------------------------------------------
// TOKEN CONTRACT

//
// PUBLIC --------------------------------------------------------------
//

    // GETTER

    //returns the University Name
    function getUniversity() public view returns (string memory){
      return university;
    }

    function getContractAddress() public view returns (address){
      return address(this);
    }

    function _baseURI() internal view override returns (string memory){
      return _certificateBaseURI;
    }

    function getTokenURI(address student) public view returns (string memory){
      require(certificateAvailable[student] == true, "No token available.");
      string memory tkId = cid[student];
      return tokenURI(tkId);
    }

    function getAcceptedRequests(address student) public view returns(string memory){
      if(acceptedRequests[student]==true){return "Request accepted.";}
      else{return "Request not issued or accepted.";}
    }

    function getCertificateAvailable(address student) public view returns(string memory){
      if(certificateAvailable[student] == true){return "Diploma available.";}
      else{return "No Diploma available.";}
    }


    //returns Price of a Certificate
    function getPrice() public view whenNotPaused returns(string memory, string memory){
      return("Price in Wei", Strings.toString(CERTIFICATE_PRICE));
    }

    function getCertificateInformation(address _student, uint8 _certNumb) public view returns(CertificateInformation memory){
      require(certificateAvailable[_student]==true, "There is no Diploma available.");

        return dipContent[_student][_certNumb];

    }


    // ACTIONS

    //Students can request their Certificates here
    function requestCertificate() public payable whenNotPaused returns(string memory){
      require(msg.value == CERTIFICATE_PRICE, "Not the right amount of ether (ETH) transfered.");
      sendViaTransfer(payable(_owner), msg.value);

      if(certificateAvailable[msg.sender] == true){
        acceptedRequests[msg.sender] = true;
        emit NewCertificateRequested(msg.sender, owner());
        emit ETHTransaction(msg.value, msg.sender, owner());
        string memory _output = "Diploma has been requested. Get in touch with the Administration to get your Diploma issued.";
        return _output;
      }

      else{
        numberOfDiplomas[msg.sender] = 0;
        acceptedRequests[msg.sender] = true;
        emit NewCertificateRequested(msg.sender, owner());
        emit ETHTransaction(msg.value, msg.sender, owner());
        string memory _output = "Diploma has been requested. Get in touch with the Administration to get your Diploma issued.";
        return _output;
      }
    }

    //employees or other Universities can check if student has degree
    function requestVerification(address _studentAddress) public view returns(string memory, string memory, CertificateInformation memory){
      require(certificateAvailable[_studentAddress]==true, "There is NO diploma available!");
      uint8 number = numberOfDiplomas[_studentAddress];
      //string memory messageVerfication = "There is at least one Diploma available";
      return ("Diploma is existent! Number of available diplomas and most recent one: ", Strings.toString(numberOfDiplomas[_studentAddress]),
       dipContent[_studentAddress][number]);
    }

//
// ONLY OWNER, UNIVERISTY --------------------------------------------------
//

    //Owner can check, if students request has been accepted
    function checkCertificateRequests(address _studentAddress) public view whenNotPaused onlyOwner returns(string memory){
      if(acceptedRequests[_studentAddress] == true){ return "Certificate request has been accepted.";}
      else{ return "Certificate request has NOT been issued or accepted.";}
    }


    //mints Certificate, requires "university" to be set and for the students payment to have gone through
    function createCertificate(address _studentAddress, string memory _cid, string memory _studentFullName, uint256 _matriculationNumber,
      string memory _gpa, string memory _academicTitle)
      public onlyOwner whenNotPaused{
        require(bytes (university).length > 0, "ADMINISTRATION ERROR: University is not set"); //making sure, university name has been set
        require(acceptedRequests[_studentAddress]==true, "STUDENT ERROR: Student has not requested the Certificate.");

        //creates new Certificate content for student
        CertificateInformation memory newCert = CertificateInformation(_studentFullName, _matriculationNumber,
          _gpa, university, _academicTitle);

        numberOfDiplomas[_studentAddress]++;
        uint8 number = numberOfDiplomas[_studentAddress];

        //maps students address to content
        dipContent[_studentAddress][ number] = newCert;
        cid[_studentAddress] = _cid;
        //marks student address as true, if they want to view any certificates in the future
        certificateAvailable[_studentAddress] = true;


        safeMint(_studentAddress, _cid);
        emit NewCertificateIssued(_studentAddress, _studentFullName, _academicTitle, _cid);
        reset_acceptedRequests(_studentAddress);
      }

      // GETTER & SETTER

      function getContractBalance() internal view onlyOwner returns (uint256) {
          return address(this).balance;
      }

      //University set their University Name here
      function setUniversity(string memory _university) public onlyOwner returns(string memory){
        university = _university;
        return university;
      }

      //If Price needs to be adjusted
      function editPrice(uint256 _CERTIFICATE_PRICE) public whenNotPaused onlyOwner{
        CERTIFICATE_PRICE = _CERTIFICATE_PRICE;
      }


      function safeMint(address to, string memory tokenId) public whenNotPaused onlyOwner {
          //string tokenId = _tokenIdCounter.current(); //sets tokenId to current tokenIdCounter
          //_tokenIdCounter.increment(); //increments tokenIdCounter

          _safeMint(to, tokenId); //NFT is minted to address and tokenId
        }

      function withdraw (uint _amount) external onlyOwner {
        require(_amount <= getContractBalance(), "Not possible to withdraw more ETH than available.");
        payable(_owner).transfer(_amount);
        emit ETHTransaction(_amount, msg.sender, _owner);
      }

      function withdrawAll () external onlyOwner {
        payable(_owner).transfer(address(this).balance);
        emit ETHTransaction(address(this).balance, msg.sender, _owner);
      }


      function pause() public onlyOwner {
          _pause();
      }

      function unpause() public onlyOwner {
          _unpause();
      }

  //
  // INTERNAL --------------------------------------------------------------
  //

      //resets the students address to false, prevents issues when they request another certificate
      function reset_acceptedRequests(address _studentAddress) internal {
        require(acceptedRequests[_studentAddress] == true, "ERROR: no Certificate requested.");
        acceptedRequests[_studentAddress] = false;
      }

      function _beforeTokenTransfer(address from, address to, string memory tokenId) internal whenNotPaused override {
        super._beforeTokenTransfer(from, to, tokenId);
      }

//------------------------------------------------------------------------------

//
// RECEIVE ETHER
//

      receive() external payable{
        emit Log("receive", msg.value, msg.sender, "");
      }

      fallback() external payable{
        emit Log("fallback", msg.value, msg.sender, msg.data);
      }

      function getBalance() public view returns (uint256){
        return address(this).balance;
      }

//------------------------------------------------------------------------------

//
// SEND ETHER
//

      function sendViaTransfer(address payable _to, uint _amount) public payable returns(bool){
        _to.transfer(_amount);
        return true;
      }

    }
